import React from "react";
import { Col, Row, Container } from "../components/Grid";
import v2Inventory from "../components/v2Inventory"

const v2InventoryPage = () => {
    return (
      <Container fluid>
        <h1>v2Inventory</h1>
        <br />
        <a href="/home">Home</a>
        
        <v2Inventory/>
      </Container>
    );
  };
  
  export default v2InventoryPage;
